'''Кечгурт''' ( Ӟуч кыл|ӟуч сямен ''Козино'') — интыяськемын Шаркан ёрос лэн уйпалаз ( Удмуртия ). Татын 66 корка, 190 улӥсьёсыз. Соос пӧлысь ужан арлыдын — 130, школае ветлӥсез — 27, мӧйыос — 40 пала. Пиналъёс дышетскын ветло Пороз (Порозово) школае. Гуртын вань клуб, одӥг райполэн магазинэз но куинь частной магазин, гараж, молочно-товарной ферма, кунян гид, вал гид, пилорама, кузница. Калыклы юрттэт сётэ больница (ФАП). Урам — со гуртлэн ымнырыз. Кечгуртын ваньмыз-ӧвӧлэз куинь урам: * Бакипал — ул. Зелёная;
* Балтачпал — ул. Родниковая;
* Танатар — ул. Молодёжная. Самой кузез Родниковой урам (2 км), нош самой пичиез — Молодёжной (500 м). Самой вужез, вашкалаез луэ Зелёной урам (1,5 км). Гуртлэн кылдэмез кутске та ульчаысен. Нырысь ик калык, пе, отчы интыяськем. Кылем даурлэн кутсконаз гинэ но ай куд-ог удмуртъёс люкен-люкен, бӧлякен улӥллям. Одӥг люк — одӥг выжылэн, мукет люк — мукетызлэн. Озьы ик Кечгуртын но ӵем пумисько таӵе фамилиос: Корепанов но Ефремов. Кыдёкын ик ӧвӧл Кечгуртлэсь сыло Сильво (гуртъёс вискын 1,5 км); Порозово (Пороз) — 9 км; Карсашур (Карса) — 7 км; Гондырвай — 9 км; Ниж. Кивары (Балтач) — 2 км; Вверх. Кивары (Тюар) — 2,5 км. Карез, бадӟым сюресэз учконо ке, Кечгурт дорысен туж матын ӧвӧл. Кечгурт дорысен райцентырозь 25 км; матысь карозь — Вотка озь — 40км, но бадӟым сюресозь 15 км. 	211	1	1	26	14	23	"good"

